    true,nt"url": null,nt"notes": "The Technology Performance Exchange (TPEx)
    is a centralized, Web-based portal for finding and sharing energy performance data
    for commercial building technologies. Individuals who manufacture, supply, test,
    or evaluate technologies can use data entry forms to upload standardized, product-specific
    energy performance data. The Technology Performance Exchange also allows technology
    evaluators to quickly and easily identify who submitted data, when the data were
    submitted, and how the data were derived. Technology evaluators can leverage the
    raw data contained in the Technology Performance Exchange to (1) greatly reduce
    the time required to evaluate technology performance; and (2) improve the quality
    of their assessments. Energy-saving products will thus be able to penetrate the
    marketplace more quickly than ever before. ",nt"license_title": "Creative
